import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './Admin.css';

function Admin() {
  const navigate = useNavigate();
  const [plz, setPlz] = useState('');
  const [authorization, setAuthorization] = useState('');
  const [prio, setPrio] = useState('');
  const [datum, setDatum] = useState('');
  const [termins, setTermins] = useState([]);
  const [responseDataPlz, setResponseDataPlz] = useState([]);
  const [responseDataPrio, setResponseDataPrio] = useState([]);
  const [responseDataDate, setResponseDataDate] = useState([]);

  const handleAdminClick = () => {
    navigate('/admin');
  };

  const handleFetchByPlz = async () => {
    try {
      const response = await axios.post(
        'https://9xna35s7vi.execute-api.eu-central-1.amazonaws.com/dev/admin/getuserbyzipcode',
        {
          "PLZ": plz
        },
        {
          headers: {
            'Authorization': authorization
          }
        }
      );
      setResponseDataPlz(response.data);
    } catch (error) {
      console.error('Error fetching data by PLZ:', error);
    }
  };

  const handleFetchByPrio = async () => {
    try {
      const response = await axios.post(
        'https://9xna35s7vi.execute-api.eu-central-1.amazonaws.com/dev/admin/getuserbyprio',
        {
          "prio": parseInt(prio)
        },
        {
          headers: {
            'Authorization': authorization
          }
        }
      );
      setResponseDataPrio(response.data);
    } catch (error) {
      console.error('Error fetching data by priority:', error);
    }
  };

  const handleFetchByDate = async () => {
    try {
      const response = await axios.post(
        'https://9xna35s7vi.execute-api.eu-central-1.amazonaws.com/dev/admin/getuserbydate',
        {
          "PLZ": plz,
          "Datum": datum,
          "Termine": termins
        },
        {
          headers: {
            'Authorization': authorization
          }
        }
      );
      setResponseDataDate(response.data);
    } catch (error) {
      console.error('Error fetching data by date:', error);
    }
  };

  return (
    <div className="Admin">
      <h1>Welcome to the Admin Page</h1>
      <button onClick={handleAdminClick}>Go to Admin Page</button>
      <div className="input-container">
        <input
          type="text"
          placeholder="Auth Token"
          value={authorization}
          onChange={(e) => setAuthorization(e.target.value)}
        />
        <input
          type="text"
          placeholder="PLZ"
          value={plz}
          onChange={(e) => setPlz(e.target.value)}
        />
        <button onClick={handleFetchByPlz}>Fetch Data by PLZ</button>
        <input
          type="number"
          placeholder="Priority"
          value={prio}
          onChange={(e) => setPrio(e.target.value)}
        />
        <button onClick={handleFetchByPrio}>Fetch Data by Priority</button>
        <input
          type="date"
          placeholder="Date"
          value={datum}
          onChange={(e) => setDatum(e.target.value)}
        />
        <div>
          <label>
            <input
              type="checkbox"
              value="10:00"
              checked={selectedTimes.includes('10:00')}
              onChange={(e) => {
                if (e.target.checked) {
                  setSelectedTimes([...selectedTimes, e.target.value]);
                } else {
                  setSelectedTimes(selectedTimes.filter(time => time !== e.target.value));
                }
              }}
            />
            10:00
          </label>
          <label>
            <input
              type="checkbox"
              value="10:10"
              checked={selectedTimes.includes('10:10')}
              onChange={(e) => {
                if (e.target.checked) {
                  setSelectedTimes([...selectedTimes, e.target.value]);
                } else {
                  setSelectedTimes(selectedTimes.filter(time => time !== e.target.value));
                }
              }}
            />
            10:10
          </label>
          {/* Add more checkbox options as needed */}
        </div>
        <button onClick={handleFetchByDate}>Fetch Data by Date</button>
      </div>
    </div>
  );
}

export default Admin;
